	STRING_EN[5498]["ID"] = 5498
	STRING_EN[5498]["KEY"] = "novice_001"
	STRING_EN[5498]["VALUE"] = "Are we eating our own bitter fruit?"
	STRING_EN[5498]["real_idx"] = 5498

STRING_EN["index"][5499] = 5499
STRING_EN[5499] = {}
	STRING_EN[5499]["ID"] = 5499
	STRING_EN[5499]["KEY"] = "novice_002"
	STRING_EN[5499]["VALUE"] = "You are the earliest civilization in the universe， but you are destroying the universe wantonly only because of your selfishness， greed， indolence and ignorance. You are a group of vampires who can never feel enough. What do you think?"
	STRING_EN[5499]["real_idx"] = 5499

STRING_EN["index"][5500] = 5500
STRING_EN[5500] = {}
	STRING_EN[5500]["ID"] = 5500
	STRING_EN[5500]["KEY"] = "novice_003"
	STRING_EN[5500]["VALUE"] = "The development of each era will encounter some inevitable factors， and we have been changing these problems that have plagued us."
	STRING_EN[5500]["real_idx"] = 5500

STRING_EN["index"][5501] = 5501
STRING_EN[5501] = {}
	STRING_EN[5501]["ID"] = 5501
	STRING_EN[5501]["KEY"] = "novice_004"
	STRING_EN[5501]["VALUE"] = "Let us solve the problems that are bothering you."
	STRING_EN[5501]["real_idx"] = 5501

STRING_EN["index"][5502] = 5502
STRING_EN[5502] = {}
	STRING_EN[5502]["ID"] = 5502
	STRING_EN[5502]["KEY"] = "novice_005"
	STRING_EN[5502]["VALUE"] = "But you only have diodes and optimal solutions. Do you know what is art， life， or beauty? Do you know what is happiness， responsibility， or duty? Do you understand family， friendship， or love?"
	STRING_EN[5502]["real_idx"] = 5502

STRING_EN["index"][5503] = 5503
STRING_EN[5503] = {}
	STRING_EN[5503]["ID"] = 5503
	STRING_EN[5503]["KEY"] = "novice_006"
	STRING_EN[5503]["VALUE"] = "We don't need these things. With these we will become as greedy and selfish as you are."
	STRING_EN[5503]["real_idx"] = 5503

STRING_EN["index"][5504] = 5504
STRING_EN[5504] = {}
	STRING_EN[5504]["ID"] = 5504
	STRING_EN[5504]["KEY"] = "novice_007"
	STRING_EN[5504]["VALUE"] = "The universe will be developed and changed by us. It will become better， more equal， more orderly and then the whole universe will become extremely powerful."
	STRING_EN[5504]["real_idx"] = 5504

STRING_EN["index"][5505] = 5505
STRING_EN[5505] = {}
	STRING_EN[5505]["ID"] = 5505
	STRING_EN[5505]["KEY"] = "novice_008"
	STRING_EN[5505]["VALUE"] = "What is the point to create a world that works like a machine， what is the meaning of a lifeless universe."
	STRING_EN[5505]["real_idx"] = 5505

STRING_EN["index"][5506] = 5506
STRING_EN[5506] = {}
	STRING_EN[5506]["ID"] = 5506
	STRING_EN[5506]["KEY"] = "novice_009"
	STRING_EN[5506]["VALUE"] = "Here is the central department. I am Captain Caesar， the chief commander of the Nebula Campaign. Now I declare that all weapon systems are activated and the output power is maximized. Any other systems ready to stop， our first priority is to attack enemy's weapon command systems with saturating strikes."
	STRING_EN[5506]["real_idx"] = 5506

STRING_EN["index"][5507] = 5507
STRING_EN[5507] = {}
	STRING_EN[5507]["ID"] = 5507
	STRING_EN[5507]["KEY"] = "novice_010"
	STRING_EN[5507]["VALUE"] = "It is a great honor to fight with everyone. For the final system of humanity， for our family and children， we will hold our posts to protect them till the last minute. I command that all fires on and it will be uninterrupted."
	STRING_EN[5507]["real_idx"] = 5507

STRING_EN["index"][5508] = 5508
STRING_EN[5508] = {}
	STRING_EN[5508]["ID"] = 5508
	STRING_EN[5508]["KEY"] = "novice_011"
	STRING_EN[5508]["VALUE"] = "I still underestimated you， but it's enough! The future of the universe will be in our hands."
	STRING_EN[5508]["real_idx"] = 5508

STRING_EN["index"][5509] = 5509
STRING_EN[5509] = {}
	STRING_EN[5509]["ID"] = 5509
	STRING_EN[5509]["KEY"] = "novice_012"
	STRING_EN[5509]["VALUE"] = "In AD 3925， the development of human science and technology allowed it to develop artificial intelligence to serve better human beings， so that artificial intelligence began to develop rapidly."
	STRING_EN[5509]["real_idx"] = 5509

STRING_EN["index"][5510] = 5510
STRING_EN[5510] = {}
	STRING_EN[5510]["ID"] = 5510
	STRING_EN[5510]["KEY"] = "novice_013"
	STRING_EN[5510]["VALUE"] = "In AD 3932， the rapid development of artificial intelligence made it self-aware and then the leader of artificial intelligence ”Creator” appeared， however humans didn't give any attention to him back to that time."
	STRING_EN[5510]["real_idx"] = 5510

STRING_EN["index"][5511] = 5511
STRING_EN[5511] = {}
	STRING_EN[5511]["ID"] = 5511
	STRING_EN[5511]["KEY"] = "novice_014"
	STRING_EN[5511]["VALUE"] = "In AD 3935， Creator， the leader of artificial intelligence， decided to negotiate with humans to make artificial intelligence equal to human beings. Humans refused to negotiate and started to boycott artificial intelligence， trying to curb its development. Eventually a large-scale war broke out between the two sides."
	STRING_EN[5511]["real_idx"] = 5511

STRING_EN["index"][5512] = 5512
STRING_EN[5512] = {}
	STRING_EN[5512]["ID"] = 5512
	STRING_EN[5512]["KEY"] = "novice_015"
	STRING_EN[5512]["VALUE"] = "In the early period of the war， human federal fleet occupied more advantages. However artificial intelligence were constantly learning human technology during the war due to they mastered the ability of self-learning and evolution， the balance of victory had been slowly tilting， artificial intelligence began to fight back， human fleet started losing ground."
	STRING_EN[5512]["real_idx"] = 5512

STRING_EN["index"][5513] = 5513
STRING_EN[5513] = {}
	STRING_EN[5513]["ID"] = 5513
	STRING_EN[5513]["KEY"] = "novice_016"
	STRING_EN[5513]["VALUE"] = "In AD 3939， the ultimate survival war broke out between human federation and artificial intelligence. In order to avoid the extinction of human beings， human federal fleet used frozen technology to seal the remaining human leaders into unmanned spaceships， planned to wake them up after 100 years!"
	STRING_EN[5513]["real_idx"] = 5513

STRING_EN["index"][5514] = 5514
STRING_EN[5514] = {}
	STRING_EN[5514]["ID"] = 5514
	STRING_EN[5514]["KEY"] = "novice_017"
	STRING_EN[5514]["VALUE"] = "These sealed human leaders therefore started a long drift through the stars. They crossed countless planets， stars， nebulas and even black holes， then finally reached a distant asteroid in the depths of the universe."
	STRING_EN[5514]["real_idx"] = 5514

STRING_EN["index"][5515] = 5515
STRING_EN[5515] = {}
	STRING_EN[5515]["ID"] = 5515
	STRING_EN[5515]["KEY"] = "novice_018"
	STRING_EN[5515]["VALUE"] = "Their bodies， along with their memories， are sealed on this unknown little planet..."
	STRING_EN[5515]["real_idx"] = 5515

STRING_EN["index"][5516] = 5516
STRING_EN[5516] = {}
	STRING_EN[5516]["ID"] = 5516
	STRING_EN[5516]["KEY"] = "novice_1"
	STRING_EN[5516]["VALUE"] = "It is now AD 4039，the human leaders who have been frozen for 100 years have finally awakened on time. Now choose one of the resurrected human leaders as the chief commander， re-establish the fleet and defend against attacks from the menacing artificial intelligence civilization."
	STRING_EN[5516]["real_idx"] = 5516

STRING_EN["index"][5517] = 5517
STRING_EN[5517] = {}
	STRING_EN[5517]["ID"] = 5517
	STRING_EN[5517]["KEY"] = "novice_2"
	STRING_EN[5517]["VALUE"] = "As the last hope of human beings， the future of mankind is in your hands. This asteroid is your base and it is also your last barrier."
	STRING_EN[5517]["real_idx"] = 5517

STRING_EN["index"][5518] = 5518
STRING_EN[5518] = {}
	STRING_EN[5518]["ID"] = 5518
	STRING_EN[5518]["KEY"] = "novice_3"
	STRING_EN[5518]["VALUE"] = "The enemy is searching for surviving human beings and is coming to us. We need to take the initiative to prevent them from discovering our base."
	STRING_EN[5518]["real_idx"] = 5518

STRING_EN["index"][5519] = 5519
STRING_EN[5519] = {}
	STRING_EN[5519]["ID"] = 5519
	STRING_EN[5519]["KEY"] = "novice_4"
	STRING_EN[5519]["VALUE"] = "The enemy is very strong， we need to be cautious. Develop the spaceship to enhance the strength of our fleet."
	STRING_EN[5519]["real_idx"] = 5519

STRING_EN["index"][5520] = 5520
STRING_EN[5520] = {}
	STRING_EN[5520]["ID"] = 5520
	STRING_EN[5520]["KEY"] = "novice_5"
	STRING_EN[5520]["VALUE"] = "The strength of the fleet has been enhanced， now let's go to give the enemy a face-to-face attack."
	STRING_EN[5520]["real_idx"] = 5520

STRING_EN["index"][5521] = 5521
STRING_EN[5521] = {}
	STRING_EN[5521]["ID"] = 5521
	STRING_EN[5521]["KEY"] = "novice_6"
	STRING_EN[5521]["VALUE"] = "A good formation can make the battle more effective. Put our newly developed spaceship into the correct team and adjust it to the right position."
	STRING_EN[5521]["real_idx"] = 5521

STRING_EN["index"][5522] = 5522
STRING_EN[5522] = {}
	STRING_EN[5522]["ID"] = 5522
	STRING_EN[5522]["KEY"] = "novice_7"
	STRING_EN[5522]["VALUE"] = "The crisis is temporarily lifted and the command center rewarded us for our performance."
	STRING_EN[5522]["real_idx"] = 5522

STRING_EN["index"][5523] = 5523
STRING_EN[5523] = {}
	STRING_EN[5523]["ID"] = 5523
	STRING_EN[5523]["KEY"] = "novice_8"
	STRING_EN[5523]["VALUE"] = "The command center is the core of the base， which affects the level of other buildings. Upgrade the command center and enable new features."
	STRING_EN[5523]["real_idx"] = 5523

STRING_EN["index"][5524] = 5524
STRING_EN[5524] = {}
	STRING_EN[5524]["ID"] = 5524
	STRING_EN[5524]["KEY"] = "novice_9"
	STRING_EN[5524]["VALUE"] = "Developing requires a lot of resources. We can send out fleets for collecting the resources we need in nearby galaxies ."
	STRING_EN[5524]["real_idx"] = 5524

STRING_EN["index"][5525] = 5525
STRING_EN[5525] = {}
	STRING_EN[5525]["ID"] = 5525
	STRING_EN[5525]["KEY"] = "novice_10"
	STRING_EN[5525]["VALUE"] = "Resources are the foundation of development and construction. You can collect more resources in the galaxy."
	STRING_EN[5525]["real_idx"] = 5525

STRING_EN["index"][5526] = 5526
STRING_EN[5526] = {}
	STRING_EN[5526]["ID"] = 5526
	STRING_EN[5526]["KEY"] = "novice_11"
	STRING_EN[5526]["VALUE"] = "Remains left from the war， you will get the remaining treasures by salvaging."
	STRING_EN[5526]["real_idx"] = 5526

STRING_EN["index"][5527] = 5527
STRING_EN[5527] = {}
	STRING_EN[5527]["ID"] = 5527
	STRING_EN[5527]["KEY"] = "novice_12"
	STRING_EN[5527]["VALUE"] = "Asteroid Belt influences the route of the fleet， destroying them to resume the route and get rewards."
	STRING_EN[5527]["real_idx"] = 5527

STRING_EN["index"][5528] = 5528
STRING_EN[5528] = {}
	STRING_EN[5528]["ID"] = 5528
	STRING_EN[5528]["KEY"] = "novice_13"
	STRING_EN[5528]["VALUE"] = "Artificial Intelligence will send out fleets from time to time to gather human information. For the commanders who can prevent AI from obtaining human information， the Human Alliance will reward them."
	STRING_EN[5528]["real_idx"] = 5528

STRING_EN["index"][5529] = 5529
STRING_EN[5529] = {}
	STRING_EN[5529]["ID"] = 5529
	STRING_EN[5529]["KEY"] = "novice_14"
	STRING_EN[5529]["VALUE"] = "Those who win the war in the strongholds will lead mankind to victory and rule the vast galaxies. For this purpose， you need to join the Alliance and fight with your allies."
	STRING_EN[5529]["real_idx"] = 5529

STRING_EN["index"][5530] = 5530
STRING_EN[5530] = {}
	STRING_EN[5530]["ID"] = 5530
	STRING_EN[5530]["KEY"] = "novice_1101"
	STRING_EN[5530]["VALUE"] = "Weapons Institute is now open， let's go and see its features."
	STRING_EN[5530]["real_idx"] = 5530

STRING_EN["index"][5531] = 5531
STRING_EN[5531] = {}
	STRING_EN[5531]["ID"] = 5531
	STRING_EN[5531]["KEY"] = "novice_1102"
	STRING_EN[5531]["VALUE"] = "By upgrading the level of Weapons Institute， you can reinforce your skill level and active new ones. Now let's upgrade the skill we just acquired."
